// 데이터 전처리
const processedData = [];

for (const item of $input.all()) {
  const data = item.json;

  // 조회수 변환 (1.3M -> 1300000)
  function convertViews(viewStr) {
    if (!viewStr) return 0;
    const numStr = viewStr.toString().toLowerCase();
    if (numStr.includes('k')) {
      return parseFloat(numStr.replace('k', '')) * 1000;
    } else if (numStr.includes('m')) {
      return parseFloat(numStr.replace('m', '')) * 1000000;
    } else if (numStr.includes('b')) {
      return parseFloat(numStr.replace('b', '')) * 1000000000;
    }
    return parseInt(numStr.replace(/[^0-9]/g, '')) || 0;
  }

  // 구독자 수 변환
  function convertSubscribers(subStr) {
    return convertViews(subStr);
  }

  // 게시일 변환 (x days ago -> 실제 날짜)
  function convertPublishDate(dateStr) {
    if (!dateStr) return new Date().toISOString().split('T')[0];

    const today = new Date();
    if (dateStr.includes('day')) {
      const days = parseInt(dateStr.match(/\d+/)?.[0] || '0');
      const publishDate = new Date(today.getTime() - (days * 24 * 60 * 60 * 1000));
      return publishDate.toISOString().split('T')[0];
    } else if (dateStr.includes('week')) {
      const weeks = parseInt(dateStr.match(/\d+/)?.[0] || '0');
      const publishDate = new Date(today.getTime() - (weeks * 7 * 24 * 60 * 60 * 1000));
      return publishDate.toISOString().split('T')[0];
    } else if (dateStr.includes('month')) {
      const months = parseInt(dateStr.match(/\d+/)?.[0] || '0');
      const publishDate = new Date(today.getFullYear(), today.getMonth() - months, today.getDate());
      return publishDate.toISOString().split('T')[0];
    }
    return dateStr;
  }

  const processed = {
    channel: data.channel || data['채널명'] || '',
    title: data.title || data['제목'] || '',
    views: convertViews(data.views || data['조회수'] || '0'),
    subscribers: convertSubscribers(data.subscribers || data['구독자수'] || '0'),
    publishDate: convertPublishDate(data.publishDate || data['게시일'] || ''),
    collectDate: new Date().toISOString().split('T')[0],
    originalViews: data.views || data['조회수'] || '',
    originalSubscribers: data.subscribers || data['구독자수'] || '',
    originalPublishDate: data.publishDate || data['게시일'] || ''
  };

  // 인기도 지수 계산 (조회수/구독자수 비율)
  processed.popularityRatio = processed.subscribers > 0 ? processed.views / processed.subscribers : 0;

  processedData.push(processed);
}

return processedData.map(item => ({json: item}));

// 트렌드 분석
const allData = $input.all().map(item => item.json);

// 1. 인기 급상승 콘텐츠 추출 (최근 7일 이내, 높은 인기도 비율)
const recentContent = allData.filter(item => {
  const publishDate = new Date(item.publishDate);
  const sevenDaysAgo = new Date();
  sevenDaysAgo.setDate(sevenDaysAgo.getDate() - 7);
  return publishDate >= sevenDaysAgo;
});

const trendingContent = recentContent
  .sort((a, b) => b.popularityRatio - a.popularityRatio)
  .slice(0, 10);

// 2. 채널별 통계
const channelStats = {};
allData.forEach(item => {
  if (!channelStats[item.channel]) {
    channelStats[item.channel] = {
      channel: item.channel,
      totalViews: 0,
      maxViews: 0,
      contentCount: 0,
      subscribers: item.subscribers
    };
  }

  channelStats[item.channel].totalViews += item.views;
  channelStats[item.channel].maxViews = Math.max(channelStats[item.channel].maxViews, item.views);
  channelStats[item.channel].contentCount += 1;
});

// 평균 조회수 계산
Object.keys(channelStats).forEach(channel => {
  channelStats[channel].avgViews = channelStats[channel].totalViews / channelStats[channel].contentCount;
  channelStats[channel].avgVsMax = channelStats[channel].avgViews / channelStats[channel].maxViews;
});

// 3. Top 콘텐츠 순위
const topContent = allData
  .sort((a, b) => b.views - a.views)
  .slice(0, 20);

// 분석 결과 반환
const analysisResult = {
  summary: {
    totalContent: allData.length,
    totalChannels: Object.keys(channelStats).length,
    avgViews: allData.reduce((sum, item) => sum + item.views, 0) / allData.length,
    collectDate: new Date().toISOString().split('T')[0]
  },
  trendingContent: trendingContent,
  channelStats: Object.values(channelStats),
  topContent: topContent,
  rawData: allData
};

return [{json: analysisResult}];

// 차트 데이터 준비
const analysisData = $input.first().json;
const claudeAnalysis = $input.all()[1]?.json?.choices?.[0]?.message?.content || '';

// Top 콘텐츠 차트 데이터
const topContentChart = {
  type: 'bar',
  data: {
    labels: analysisData.topContent.slice(0, 10).map(item => item.title.substring(0, 30) + '...'),
    datasets: [{
      label: '조회수',
      data: analysisData.topContent.slice(0, 10).map(item => item.views),
      backgroundColor: 'rgba(255, 99, 132, 0.2)',
      borderColor: 'rgba(255, 99, 132, 1)',
      borderWidth: 1
    }]
  },
  options: {
    responsive: true,
    plugins: {
      title: {
        display: true,
        text: 'Top 10 YouTube 콘텐츠 (조회수 기준)'
      }
    },
    scales: {
      y: {
        beginAtZero: true
      }
    }
  }
};

// 채널별 평균 vs 최고 조회수 비교
const channelComparisonChart = {
  type: 'scatter',
  data: {
    datasets: [{
      label: '채널별 평균 vs 최고 조회수',
      data: analysisData.channelStats.slice(0, 15).map(channel => ({
        x: channel.avgViews,
        y: channel.maxViews,
        label: channel.channel
      })),
      backgroundColor: 'rgba(54, 162, 235, 0.2)',
      borderColor: 'rgba(54, 162, 235, 1)'
    }]
  },
  options: {
    responsive: true,
    plugins: {
      title: {
        display: true,
        text: '채널별 평균 조회수 vs 최고 조회수'
      }
    },
    scales: {
      x: {
        display: true,
        title: {
          display: true,
          text: '평균 조회수'
        }
      },
      y: {
        display: true,
        title: {
          display: true,
          text: '최고 조회수'
        }
      }
    }
  }
};

const result = {
  analysisData: analysisData,
  claudeAnalysis: claudeAnalysis,
  charts: {
    topContent: topContentChart,
    channelComparison: channelComparisonChart
  }
};

return [{json: result}];

